int find_min_time(Map *map) {
  int queue[MAX_WIDTH * MAX_HEIGHT][3]; // Queue to store ant states
  int front = 0, rear = 0;
  int visited[MAX_HEIGHT][MAX_WIDTH] = {0}; // Array to track visited cells

  // Add initial ant state to the queue
  queue[rear][0] = map->ant.x;
  queue[rear][1] = map->ant.y;
  queue[rear][2] = 0;
  rear++;
  visited[map->ant.y][map->ant.x] = 1;

  // Perform BFS
  while (front < rear) {
    int x = queue[front][0];
    int y = queue[front][1];
    int time = queue[front][2];
    front++;

    // Check if the hole is reached with positive HP
    if (map->grid[y][x] == 3 && map->ant.hp > 0) {
      return time;
    }

    // Explore possible moves
    if (is_valid_move(map, x + 1, y) && !visited[y][x + 1]) {
      move_ant(map, x + 1, y);
      queue[rear][0] = x + 1;
      queue[rear][1] = y;
      queue[rear][2] = time + 1;
      rear++;
      visited[y][x + 1] = 1;
      move_ant(map, x, y); // Reset ant state
    }
    if (is_valid_move(map, x - 1, y) && !visited[y][x - 1]) {
      move_ant(map, x - 1, y);
      queue[rear][0] = x - 1;
      queue[rear][1] = y;
      queue[rear][2] = time + 1;
      rear++;
      visited[y][x - 1] = 1;
      move_ant(map, x, y);
    }
    if (is_valid_move(map, x, y + 1) && !visited[y + 1][x]) {
      move_ant(map, x, y + 1);
      queue[rear][0] = x;
      queue[rear][1] = y + 1;
      queue[rear][2] = time + 1;
      rear++;
      visited[y + 1][x] = 1;
      move_ant(map, x, y);
    }
    if (is_valid_move(map, x, y - 1) && !visited[y - 1][x]) {
      move_ant(map, x, y - 1);
      queue[rear][0] = x;
      queue[rear][1] = y - 1;
      queue[rear][2] = time + 1;
      rear++;
      visited[y - 1][x] = 1;
      move_ant(map, x, y);
    }
  }

  return -1; // Ant cannot reach the hole
}
